import React from 'react'
import "./UtilsArea.css"

export default function UtilsArea() {
    return (
        <div className="utils_area">
            <div id="utils_navbar">
                <button id="utils_header">Utils Info</button>
            </div>
            <div id="utils">
            </div>
        </div>
    )
}
